import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';

import './App.css';

function App() {
  return (
    <Router>
    <div className="App">
      <h1>Auth-Friends</h1>
      <Switch>
      <Route></Route>
      <Route></Route>
      <Route></Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
